import React from 'react'

export default function Filters() {

    function handleClick(tag) {
        setState({
            activeDiv: tag
        });
    }

    return (
        <div className="page-filters">
            <div onClick={handleClick('all')} className="filter active" data-filter="all"><span className="icon-all"></span><p>All</p></div>
            <div onClick={handleClick('new')} className="filter" data-filter="new"><span className="icon-new"></span><p>New</p></div>
            <div onClick={handleClick('top')} className="filter" data-filter="top"><span className="icon-top"></span><p>Top</p></div>
        </div>
    )
}
